function App() {

  const {register, handleSubmit} = useForm();

  return(
    <div className="p-4">
        <form action="" onSubmit={(handleSubmit(data => console.log(data) ))}>
          <input {...register("name")} className="border-2" type="text" placeholder="name" />

          <input {...register("email")} className="border-2 m-3" type="email" placeholder="email" />
          {/* <input type="submit" /> */}
          <button className={`px-2 py-1 bg-red-400 text-xs font-semibold text-zinc-100 rounded mt-3 m-2`}> submit</button>
        </form>
    </div>
  );
}

export default App;
